(629336, E'TDistrib', E'{87.029001,Alexander 2019c,England: modern records from just four locations: Monks Wood NNR, Hunts, one seen walking on low vegetation about 25cm off the ground, 3.vi.2016 & 30.v.2017, Frank Porch (via Longhorn Beetle Recording Scheme but not known from here previously despite it being a very well recorded site. New Forest (i.e. Hollands Wood), 30.vi.2013, Peter Wilson verified by Paul Brock; earlier records from this forest are: i) beaten off oak, June 1908, A. Ford [Uhthoff-Kaufmann 1997]; and ii) one taken in June 1917 by C. Gulliver, the latter record is given as ‘Brockenhurst’in the NBN Atlas; Wappenbury Wood Nature Reserve, Warks, one live on the ground near some isolated dead trees in parkland, 14.vi.1996 [Forsythe 1997]; Ashtead Common, Surrey, 7.vi.2000. Sites with no modern records are as follows: Harewood Forest, Hants; Hankley Common & Coombe Wood, Kingston, Surrey; Windsor Forest, Berks; Gamlingay area, Cambs; Hainault Forest, Essex; Darenth Wood & Birch Wood, Kent ; Colney Hatch Wood, Middlesex. The species is endemic to Europe and occurs widely across the temperate zone, extending S to the Mediterranean [Bense 1995]; a record from Transcaucasia needs confirmation (Sama 2002); extremely rare and very local in Sweden and Denmark (Ehnström 2007); in the Iberian peninsula only in the northern half (Vives 2001). Has become rarer and more localized on the Continent.}', null, E'tbl_text_distribution', 73979, '2020-03-13 13:16:45.1594700+01', E'INSERT', E'{87.029001,Alexander 2019c,England: modern records from just four locations: Monks Wood NNR, Hunts, one seen walking on low vegetation about 25cm off the ground, 3.vi.2016 & 30.v.2017, Frank Porch (via Longhorn Beetle Recording Scheme but not known from here previously despite it being a very well recorded site. New Forest (i.e. Hollands Wood), 30.vi.2013, Peter Wilson verified by Paul Brock; earlier records from this forest are: i) beaten off oak, June 1908, A. Ford [Uhthoff-Kaufmann 1997]; and ii) one taken in June 1917 by C. Gulliver, the latter record is given as ‘Brockenhurst’in the NBN Atlas; Wappenbury Wood Nature Reserve, Warks, one live on the ground near some isolated dead trees in parkland, 14.vi.1996 [Forsythe 1997]; Ashtead Common, Surrey, 7.vi.2000. Sites with no modern records are as follows: Harewood Forest, Hants; Hankley Common & Coombe Wood, Kingston, Surrey; Windsor Forest, Berks; Gamlingay area, Cambs; Hainault Forest, Essex; Darenth Wood & Birch Wood, Kent ; Colney Hatch Wood, Middlesex. The species is endemic to Europe and occurs widely across the temperate zone, extending S to the Mediterranean [Bense 1995]; a record from Transcaucasia needs confirmation (Sama 2002); extremely rare and very local in Sweden and Denmark (Ehnström 2007); in the Iberian peninsula only in the northern half (Vives 2001). Has become rarer and more localized on the Continent.}'),
