(629416, E'TDistrib', E'{10.006001,Lane 2017,England: currently restricted to the S and W coasts and Wales. In W known from S Somerset, Dunster Beach (1998), N to Anglesey, Newborough Warren (2008 and 2012). The other known sites for H. punctum within this coastal swathe are N Somerset, Berrow  (last recorded 2014), Braunton Burrows (last definitely recorded 1965), Glamorgan, Merthyrmawr Warren, (last recorded 2003), Crymlyn Burrows, (last recorded 2001), Oxwich Bay (last recorded 1920), Carmathens, Burry Port (last recorded 1993) and Merioneth, Llanbedr (last recorded 1906). Previously more widely distributed with historical records pre-dating 1907 from E Cornwall, Tregantle Sands, and S Devon, Key, Plymouth,  Old records also exist E to Dorset, Chesil Beach/Portland/Weymouth area, Isle of Wight, Bembridge and S Hants, Hayling Island. The species was thought to be long-extinct along the S coast of England until its rediscovery in April 2015 at Hayling Island and also at Dorset, Kimmeridge Bay in September 2016. It is probable also that it still survives at the well-surveyed N Devon, Braunton Burrows where an as yet unconfirmed, but very probable record comes from 2015. A published record for Gumley, Leicestershire (Bouskell in [Page 1907] is almost certain to be erroneous, although it was published in [Fowler 1889]. In the Palaearctic region, it is recorded from Europe, into North Africa.}', null, E'tbl_text_distribution', 74059, '2020-03-13 13:16:45.3810490+01', E'INSERT', E'{10.006001,Lane 2017,England: currently restricted to the S and W coasts and Wales. In W known from S Somerset, Dunster Beach (1998), N to Anglesey, Newborough Warren (2008 and 2012). The other known sites for H. punctum within this coastal swathe are N Somerset, Berrow  (last recorded 2014), Braunton Burrows (last definitely recorded 1965), Glamorgan, Merthyrmawr Warren, (last recorded 2003), Crymlyn Burrows, (last recorded 2001), Oxwich Bay (last recorded 1920), Carmathens, Burry Port (last recorded 1993) and Merioneth, Llanbedr (last recorded 1906). Previously more widely distributed with historical records pre-dating 1907 from E Cornwall, Tregantle Sands, and S Devon, Key, Plymouth,  Old records also exist E to Dorset, Chesil Beach/Portland/Weymouth area, Isle of Wight, Bembridge and S Hants, Hayling Island. The species was thought to be long-extinct along the S coast of England until its rediscovery in April 2015 at Hayling Island and also at Dorset, Kimmeridge Bay in September 2016. It is probable also that it still survives at the well-surveyed N Devon, Braunton Burrows where an as yet unconfirmed, but very probable record comes from 2015. A published record for Gumley, Leicestershire (Bouskell in [Page 1907] is almost certain to be erroneous, although it was published in [Fowler 1889]. In the Palaearctic region, it is recorded from Europe, into North Africa.}'),
