(629762, E'TDistrib', E'{5.002009,Foster et al. 2016,England: East Anglia, and coastal levels in the Weald, Scotland: Dumfriesshire, [Balfour-Browne 1950] noted ''It is difficult to explain such a strange break in the distribution of this species. Possibly it once had a much wider range and the southwest Scotland locality was its last outlying stronghold.'' He also proposed the possibility of two separate invasions. Certainly some of the places in which it was known to occur (Catfield Fen, East Norfolk, and Wicken Fen, Cambs, and the subsequently drained Maxwelltown Loch, Dumfriesshire) indicate a relict status as do additional records since his time subfossil material in five sites in the Somerset Levels, nine records in four sites in one of its real strongholds on Anglesey, and in the Crymlyn Bog in Glamorgan, Cothill Fen in Berkshire, and Thompson Common in W Norfolk. G. suffriani has recently been identified from Jersey, the first record being in 1932 [Foster et al. 2014]. The possibility of two separate invasions might be tested by genetic comparisons between Anglesey and E England populations. The absence of this species from Ireland is puzzling.}', null, E'tbl_text_distribution', 74405, '2020-03-13 13:16:46.5441720+01', E'INSERT', E'{5.002009,Foster et al. 2016,England: East Anglia, and coastal levels in the Weald, Scotland: Dumfriesshire, [Balfour-Browne 1950] noted ''It is difficult to explain such a strange break in the distribution of this species. Possibly it once had a much wider range and the southwest Scotland locality was its last outlying stronghold.'' He also proposed the possibility of two separate invasions. Certainly some of the places in which it was known to occur (Catfield Fen, East Norfolk, and Wicken Fen, Cambs, and the subsequently drained Maxwelltown Loch, Dumfriesshire) indicate a relict status as do additional records since his time subfossil material in five sites in the Somerset Levels, nine records in four sites in one of its real strongholds on Anglesey, and in the Crymlyn Bog in Glamorgan, Cothill Fen in Berkshire, and Thompson Common in W Norfolk. G. suffriani has recently been identified from Jersey, the first record being in 1932 [Foster et al. 2014]. The possibility of two separate invasions might be tested by genetic comparisons between Anglesey and E England populations. The absence of this species from Ireland is puzzling.}'),
