(629915, E'TDistrib', E'{87.084003,Alexander 2019c,England: only known an established breeding species from the Isle of Ely and\r\nthe Cambs Fens. Wicken Fen was the only known breeding location in Britain for at least the last century and possibly for the last 150 years but the beetle has not been reported there since 1983. Modern records come from just a short section of the River Cam at Upware, to the west of Wicken Fen, including a small patch of willow carr. The few records from elsewhere in the country are old ones which have not been repeated and appear to arise from either chance introductions or transcription errors [Uhthoff-Kaufmann 1992b] [Twinn & Harding 1999]. It does seem feasible however that the species might still remain overlooked in other fenland sites in the SE, such as Romney Marsh where one was taken in 1883, and The Hundred Foot Washes near Downham Market where one was taken in 1888, and perhaps even in Oxon where one was taken in 1819.  Known throughout the whole of the Palaearctic region.}', null, E'tbl_text_distribution', 74558, '2020-03-13 13:16:47.2007800+01', E'INSERT', E'{87.084003,Alexander 2019c,England: only known an established breeding species from the Isle of Ely and\r\nthe Cambs Fens. Wicken Fen was the only known breeding location in Britain for at least the last century and possibly for the last 150 years but the beetle has not been reported there since 1983. Modern records come from just a short section of the River Cam at Upware, to the west of Wicken Fen, including a small patch of willow carr. The few records from elsewhere in the country are old ones which have not been repeated and appear to arise from either chance introductions or transcription errors [Uhthoff-Kaufmann 1992b] [Twinn & Harding 1999]. It does seem feasible however that the species might still remain overlooked in other fenland sites in the SE, such as Romney Marsh where one was taken in 1883, and The Hundred Foot Washes near Downham Market where one was taken in 1888, and perhaps even in Oxon where one was taken in 1819.  Known throughout the whole of the Palaearctic region.}'),
