(629965, E'TDistrib', E'{69.002002,Borowski 2009,Africa: Algeria?, South Africa  (introduced). Europe: Inhabits Iberian Peninsula and Canary Islands. Lucas (1847) reported it from Algeria (Constantine), but this record was probably based on misidentification; this species has been introduced to some European countries, and to other continents but much less frequently than M. americanum or M. affine. In view of lack of voucher specimens and new evidence for North African occurrence, M. sulcatum should be excluded from the list of beetles of continental Africa}', null, E'tbl_text_distribution', 74608, '2020-03-13 13:16:47.3628450+01', E'INSERT', E'{69.002002,Borowski 2009,Africa: Algeria?, South Africa  (introduced). Europe: Inhabits Iberian Peninsula and Canary Islands. Lucas (1847) reported it from Algeria (Constantine), but this record was probably based on misidentification; this species has been introduced to some European countries, and to other continents but much less frequently than M. americanum or M. affine. In view of lack of voucher specimens and new evidence for North African occurrence, M. sulcatum should be excluded from the list of beetles of continental Africa}'),
