(629968, E'TDistrib', E'{87.027002,Alexander 2019c,England: records are from just six locations: Watersmeet Woods, Devon, Bardney Forest, Lincs, New Forest, Hants, Savernake Forest, Wilts, the Castle Hill Deer Park and Windy Pits SSSI area of the Duncombe Park Estate, N Yorks and Nupend Wood, Fownhope, Herefords. The first five sites have had a succession of observations and the species is clearly well established in these; the status of the sixth remains unclear. It has been known in the New Forest, Watersmeet Woods and Bardney Forest (Barnes, pers. comm.) since the 19th Century. The discovery in Savernake as recently as 1972 is surprising it was never reported in the old Marlborough College Natural History Society records. The Duncombe Park area population is also relatively recent although there is an older North York Moors record from elsewhere (Marsh, pers.comm.). The 2003 Herefords record [Cooter 2004] is also surprising as this area has been studied extensively by the Woolhope Naturalists Field Club and this record may well have been the result of an accidental introduction with firewood or timber and merits further investigation. A second location in the North York Moors (Gundale) has two reports, from 1960 and 1980, but it is not known if this population survives. A record from Talgarth Park in Merioneth dates from the 1960s [Skidmore & Johnson 1969]; no reports since. There are also a few miscellaneous older reports [Twinn & Harding 1999], details not known in some cases. The beetle is known across C and S Europe, and into North Africa (Algeria) [Ehnström 2007] [Sama 2002]}', null, E'tbl_text_distribution', 74611, '2020-03-13 13:16:47.3731710+01', E'INSERT', E'{87.027002,Alexander 2019c,England: records are from just six locations: Watersmeet Woods, Devon, Bardney Forest, Lincs, New Forest, Hants, Savernake Forest, Wilts, the Castle Hill Deer Park and Windy Pits SSSI area of the Duncombe Park Estate, N Yorks and Nupend Wood, Fownhope, Herefords. The first five sites have had a succession of observations and the species is clearly well established in these; the status of the sixth remains unclear. It has been known in the New Forest, Watersmeet Woods and Bardney Forest (Barnes, pers. comm.) since the 19th Century. The discovery in Savernake as recently as 1972 is surprising it was never reported in the old Marlborough College Natural History Society records. The Duncombe Park area population is also relatively recent although there is an older North York Moors record from elsewhere (Marsh, pers.comm.). The 2003 Herefords record [Cooter 2004] is also surprising as this area has been studied extensively by the Woolhope Naturalists Field Club and this record may well have been the result of an accidental introduction with firewood or timber and merits further investigation. A second location in the North York Moors (Gundale) has two reports, from 1960 and 1980, but it is not known if this population survives. A record from Talgarth Park in Merioneth dates from the 1960s [Skidmore & Johnson 1969]; no reports since. There are also a few miscellaneous older reports [Twinn & Harding 1999], details not known in some cases. The beetle is known across C and S Europe, and into North Africa (Algeria) [Ehnström 2007] [Sama 2002]}'),
