(629973, E'TDistrib', E'{87.082004,Alexander 2019c,England: widespread in C and SE. Despite having an apparently very small distribution but greater than 2,000 km 2), there are no perceived threats, it is not considered severely fragmented, populations are not known to fluctuate and there is no reliable evidence of recent decline. The number of locations exceeds 10. The apparent decline in records almost certainly reflects under recording. The recent records are thinly scattered across much of its known range so no range contraction is suspected.}', null, E'tbl_text_distribution', 74616, '2020-03-13 13:16:47.3922650+01', E'INSERT', E'{87.082004,Alexander 2019c,England: widespread in C and SE. Despite having an apparently very small distribution but greater than 2,000 km 2), there are no perceived threats, it is not considered severely fragmented, populations are not known to fluctuate and there is no reliable evidence of recent decline. The number of locations exceeds 10. The apparent decline in records almost certainly reflects under recording. The recent records are thinly scattered across much of its known range so no range contraction is suspected.}'),
