(630049, E'TDistrib', E'{87.054001,Alexander 2019c,Difficult to assess as the original British breeding areas were only discovered relatively recently, in an area previously poorly recorded (the Wales/England border counties). The species is also regularly found in firewood logs purchased from dealers and undoubtedly gets moved around the country to a considerable extent. Its recent appearance across much of England is almost certainly as a result of movements of firewood, with increasing interest in wood burning stoves the range in Britain has recently increased more than tenfold. The total number of occupied hectads has more than doubled in the past 30 years and the trend is expected to continue into the foreseeable future. There is now reasonable confidence that exhaustive recording would find them in more than 100 hectads today. It is a common species on the near Continent.}', null, E'tbl_text_distribution', 74692, '2020-03-13 13:16:47.7243320+01', E'INSERT', E'{87.054001,Alexander 2019c,Difficult to assess as the original British breeding areas were only discovered relatively recently, in an area previously poorly recorded (the Wales/England border counties). The species is also regularly found in firewood logs purchased from dealers and undoubtedly gets moved around the country to a considerable extent. Its recent appearance across much of England is almost certainly as a result of movements of firewood, with increasing interest in wood burning stoves the range in Britain has recently increased more than tenfold. The total number of occupied hectads has more than doubled in the past 30 years and the trend is expected to continue into the foreseeable future. There is now reasonable confidence that exhaustive recording would find them in more than 100 hectads today. It is a common species on the near Continent.}'),
