(630069, E'TDistrib', E'{42.002011,Foster 2010a,England & Wales: records since 1980 are for S and N Devon, S Wilts, W Norfolk, Glamorgan, Pembroke, Ceredigion, Anglesey, Mid-west Yorks, S and N Northumberland, the latter on Holy Island. Older records add S Hants, Cambs, S and W Lancs, and Westmorland. Scotland: Roxburgh. A distribution map is provided by Foster (1995b). D. nitidulus is a central European species, reaching Norway, Sweden and the Baltic States in the N, S to eastern Spain, the Balkans and Turkey.}', null, E'tbl_text_distribution', 74712, '2020-03-13 13:16:47.7969010+01', E'INSERT', E'{42.002011,Foster 2010a,England & Wales: records since 1980 are for S and N Devon, S Wilts, W Norfolk, Glamorgan, Pembroke, Ceredigion, Anglesey, Mid-west Yorks, S and N Northumberland, the latter on Holy Island. Older records add S Hants, Cambs, S and W Lancs, and Westmorland. Scotland: Roxburgh. A distribution map is provided by Foster (1995b). D. nitidulus is a central European species, reaching Norway, Sweden and the Baltic States in the N, S to eastern Spain, the Balkans and Turkey.}'),
