(630082, E'TDistrib', E'{87.060002,Alexander 2019c,England: confined to S and E; a number of northern localities are recorded but they were obviously introductions, imported in logs and other timber. Convincing records of the species as an erstwhile indigenous species are confined to Essex, Kent and Middlesex [Kaufmann 1992a]. The only convincing records suggesting this species to be a former resident emanate from Epping Forest and Highgate Woods (A.A. Allen, in [Hyman 1992]. Already rare by the time of [Fowler 1890] with only Greenwich and Loughton given as additional localities to those in [Stephens 1830]. Known from at least the second half of the 18 th century and still present in the 1870s but not since. The poet George Crabbe (1795), lists it as flying in the woods below Belvoir, Leics. Widespread across continental Europe, extending into North Africa [Bense 1995]. Present and locally common in coastal regions of northern France, Belgium, the Netherlands, Germany, Denmark and even Norway [Rejzek 2006]}', null, E'tbl_text_distribution', 74725, '2020-03-13 13:16:47.8463420+01', E'INSERT', E'{87.060002,Alexander 2019c,England: confined to S and E; a number of northern localities are recorded but they were obviously introductions, imported in logs and other timber. Convincing records of the species as an erstwhile indigenous species are confined to Essex, Kent and Middlesex [Kaufmann 1992a]. The only convincing records suggesting this species to be a former resident emanate from Epping Forest and Highgate Woods (A.A. Allen, in [Hyman 1992]. Already rare by the time of [Fowler 1890] with only Greenwich and Loughton given as additional localities to those in [Stephens 1830]. Known from at least the second half of the 18 th century and still present in the 1870s but not since. The poet George Crabbe (1795), lists it as flying in the woods below Belvoir, Leics. Widespread across continental Europe, extending into North Africa [Bense 1995]. Present and locally common in coastal regions of northern France, Belgium, the Netherlands, Germany, Denmark and even Norway [Rejzek 2006]}'),
