(630109, E'TDistrib', E'{23.111009,Lane 2019a,Scotland: A single specimen was found in Glenmore Forest, near Loch Morlich, Aviemore, East Inverness-shire in 2006. [Schülke 2015] suggests that its population ''may be a relict of a once continuous European distribution in the early post-glacial period''. In mainland Europe (from France east to Siberia), it has a boreo-montane distribution, occurring in ancient montane forested localities where it is described as endangered or-extinct. It follows that its distribution in Britain can be expected to be restricted to the Highlands , with a very slender chance of its discovery in other mountain systems in Scotland, or perhaps in NW England and N Wales.}', null, E'tbl_text_distribution', 74752, '2020-03-13 13:16:47.9559470+01', E'INSERT', E'{23.111009,Lane 2019a,Scotland: A single specimen was found in Glenmore Forest, near Loch Morlich, Aviemore, East Inverness-shire in 2006. [Schülke 2015] suggests that its population ''may be a relict of a once continuous European distribution in the early post-glacial period''. In mainland Europe (from France east to Siberia), it has a boreo-montane distribution, occurring in ancient montane forested localities where it is described as endangered or-extinct. It follows that its distribution in Britain can be expected to be restricted to the Highlands , with a very slender chance of its discovery in other mountain systems in Scotland, or perhaps in NW England and N Wales.}'),
