(630143, E'TDistrib', E'{87.029012,Alexander 2019c,England: despite having an apparently very small distribution, there are no perceived threats, populations are not known to fluctuate and there is no reliable evidence of a recent decline. Although only recorded from 8 hectads in\r\nthe period 1990-2018, these are from a wide area within the known range, and include sites where not previously known. It appears to have always been this rarely found. The data suggests a very elusive species. It is difficult to understand why its habitat in aerial dead, decaying thin branches might be under part icular threat at present.}', null, E'tbl_text_distribution', 74786, '2020-03-13 13:16:48.2325860+01', E'INSERT', E'{87.029012,Alexander 2019c,England: despite having an apparently very small distribution, there are no perceived threats, populations are not known to fluctuate and there is no reliable evidence of a recent decline. Although only recorded from 8 hectads in\r\nthe period 1990-2018, these are from a wide area within the known range, and include sites where not previously known. It appears to have always been this rarely found. The data suggests a very elusive species. It is difficult to understand why its habitat in aerial dead, decaying thin branches might be under part icular threat at present.}'),
