(630197, E'TDistrib', E'{87.020101,Alexander 2019c,England: formerly widespread across lowlands but very localised within the Midlands and SE, and best known from Kent; strongholds were in Kent and the Wyre Forest area. The most recent records appear to be from Chattenden Woods, Kent, in 1949 , and Stourport, Worcs in the same year [Duffy 1953]; G.H. Ashe and S.E.W. Carlier in 1938 may have been the last people to record the species from the Wyre Forest. [Hyman 1992] refers to a post 1970 record from Cheshire but does not provide details; this record has been formally withdrawn by the Cheshire LRC as unverified (E. Fletcher, pers. comm .). The species is probably restricted to small isolated populations. Once a common species, it has been so relentlessly collected in the past that it is now confined to a few isolated areas in the March counties [Kaufmann 1992b]. A widespread species on the continent, known from much of C and S Europe, apart from SW, (Bense 1995) and E to the Caucasus and Iran [Ehnström & Holmer 2007]. Widely distributed in southern Sweden.}', null, E'tbl_text_distribution', 74840, '2020-03-13 13:16:48.4002940+01', E'INSERT', E'{87.020101,Alexander 2019c,England: formerly widespread across lowlands but very localised within the Midlands and SE, and best known from Kent; strongholds were in Kent and the Wyre Forest area. The most recent records appear to be from Chattenden Woods, Kent, in 1949 , and Stourport, Worcs in the same year [Duffy 1953]; G.H. Ashe and S.E.W. Carlier in 1938 may have been the last people to record the species from the Wyre Forest. [Hyman 1992] refers to a post 1970 record from Cheshire but does not provide details; this record has been formally withdrawn by the Cheshire LRC as unverified (E. Fletcher, pers. comm .). The species is probably restricted to small isolated populations. Once a common species, it has been so relentlessly collected in the past that it is now confined to a few isolated areas in the March counties [Kaufmann 1992b]. A widespread species on the continent, known from much of C and S Europe, apart from SW, (Bense 1995) and E to the Caucasus and Iran [Ehnström & Holmer 2007]. Widely distributed in southern Sweden.}'),
