(630202, E'TDistrib', E'{85.019054,Lane & Mann 2016,England: formerly recorded from only 2 localities; Cornwall, and S Lancs. Scotland: Strathclyde. All during the 19th century. Regionally Extinct. There are only three historic records for this species in Britain, and at least one of these is regarded as doubtful. [Stephens 1830] noted a record from dung at Pentire Point, Cornwall (SW76). [Sharp 1868] noted the capture of a single specimen in 1865 from Southport, S Lancs (SD31), collected by J. Sidebotham, however the validity for many of Sidebotham''s beetle captures have been questioned [Morris & Johnson 2005]. [Jessop 1986] also cites a 19th Century record from Paisley (Strathclyde), Renfrewshire (NS46). It is probable that these records represent vagrants or imported specimens and that the species never became established in our region. [Allen 1967] leaves a question mark over its merit for inclusion on the British list, pointing out the coincidence or otherwise that this species and Pleurophorus caesus, another species of questionable validity as British, have both been claimed from Pentire Point. He does, however remark of its appearance at coastal sites, and that such habitat specialisation in our region is in keeping with an old relict species approaching extinction. Duff (2012) treats the species as a non-established introduction.}', null, E'tbl_text_distribution', 74845, '2020-03-13 13:16:48.4133530+01', E'INSERT', E'{85.019054,Lane & Mann 2016,England: formerly recorded from only 2 localities; Cornwall, and S Lancs. Scotland: Strathclyde. All during the 19th century. Regionally Extinct. There are only three historic records for this species in Britain, and at least one of these is regarded as doubtful. [Stephens 1830] noted a record from dung at Pentire Point, Cornwall (SW76). [Sharp 1868] noted the capture of a single specimen in 1865 from Southport, S Lancs (SD31), collected by J. Sidebotham, however the validity for many of Sidebotham''s beetle captures have been questioned [Morris & Johnson 2005]. [Jessop 1986] also cites a 19th Century record from Paisley (Strathclyde), Renfrewshire (NS46). It is probable that these records represent vagrants or imported specimens and that the species never became established in our region. [Allen 1967] leaves a question mark over its merit for inclusion on the British list, pointing out the coincidence or otherwise that this species and Pleurophorus caesus, another species of questionable validity as British, have both been claimed from Pentire Point. He does, however remark of its appearance at coastal sites, and that such habitat specialisation in our region is in keeping with an old relict species approaching extinction. Duff (2012) treats the species as a non-established introduction.}'),
