(630390, E'TDistrib', E'{23.117009,Lane 2019a,England: formerly widespread with records from the late 19th century/early 20th century from Cumberland, Derbys, Oxon, Berks, S Devon, S Hants, Surrey and N Essex. Most of the records pre-date 1918 but there is a record from Wallington, Surrey for 1936 and a series of at least 27 specimens (in The Natural History Museum, London) from ''Cambridge'', between 1943 and 1948. It was last recorded in Britain in A.A.Allen''s garden at Blackheath, Greenwich, West Kent in October 1953 [Allen 1964].}', null, E'tbl_text_distribution', 75033, '2020-03-13 13:16:49.1820890+01', E'INSERT', E'{23.117009,Lane 2019a,England: formerly widespread with records from the late 19th century/early 20th century from Cumberland, Derbys, Oxon, Berks, S Devon, S Hants, Surrey and N Essex. Most of the records pre-date 1918 but there is a record from Wallington, Surrey for 1936 and a series of at least 27 specimens (in The Natural History Museum, London) from ''Cambridge'', between 1943 and 1948. It was last recorded in Britain in A.A.Allen''s garden at Blackheath, Greenwich, West Kent in October 1953 [Allen 1964].}'),
