(632736, E'TBiology', E'{93.104001,Rheinheimer & Hassler 2010,A widespread sp in grassland which is oligophagous on various legumes, Vicia, Lathyrus spp. Most host plants are abundant in Baden-Württemberg and occur in many habitats, from hedge to deciduous forest to grassland, grassland and grasslands, as well as ruderal tracts and extensive fields. Accordingly, the species is present in many biotopes. In earlier times the species was a pest on cultivated beans and peas.}', null, E'tbl_text_biology', 67650, '2020-03-13 13:30:29.7878710+01', E'INSERT', E'{93.104001,Rheinheimer & Hassler 2010,A widespread sp in grassland which is oligophagous on various legumes, Vicia, Lathyrus spp. Most host plants are abundant in Baden-Württemberg and occur in many habitats, from hedge to deciduous forest to grassland, grassland and grasslands, as well as ruderal tracts and extensive fields. Accordingly, the species is present in many biotopes. In earlier times the species was a pest on cultivated beans and peas.}'),
