(632779, E'TBiology', E'{93.159001,Rheinheimer & Hassler 2010,on bogs and heathland of Ericaceae. The host plant is especially Calluna vulgaris with only a few specimens from Erica tetralix. The beetle appears in May and the larvae develop in the ovaries of the host plant [Hoffmann 1954], therefore egg laying follows in late July when the heather is in bloom. Pupation follows in the autumn in the ground.}', null, E'tbl_text_biology', 67693, '2020-03-13 13:30:30.0777760+01', E'INSERT', E'{93.159001,Rheinheimer & Hassler 2010,on bogs and heathland of Ericaceae. The host plant is especially Calluna vulgaris with only a few specimens from Erica tetralix. The beetle appears in May and the larvae develop in the ovaries of the host plant [Hoffmann 1954], therefore egg laying follows in late July when the heather is in bloom. Pupation follows in the autumn in the ground.}'),
(632780, E'TBiology', E'{87.082001,Alexander 2019c,The larvae develop over 2-4 years and pupate in the wood of basal parts of living stems of aspen and of introduced Populus species, occasionally willow. It is said to prefer shaded stands of its host trees. A considerable amount of frass and wood fibre are ejected from the active tunnel entrances that are formed as an enlargement of the oviposition site. Scottish sites are typically aspen, birch and juniper stands on relatively fertile, well drained morainic deposits or steep sided river gorges [MacGowan & Begg 2002]. The circumference of inhabited trees were found to be within the range 13-187cm CBH, with a mean circumference of 47.4cm; the females were selecting for small trees, with thinner bark. The height of the tunnel entrances above ground level lay with the range 119cm, the mean being 7.19cm. Most tunnel entrances were found to be at the edge of the stand, next to open ground [MacGowan & Begg 2002]. Adult beetles are active mainly at dusk and at night; they are attracted to light. They feed on the leaves of you g aspens during July and August [Lindhe et al. 2010].}', null, E'tbl_text_biology', 67694, '2020-03-13 13:30:30.0821860+01', E'INSERT', E'{87.082001,Alexander 2019c,The larvae develop over 2-4 years and pupate in the wood of basal parts of living stems of aspen and of introduced Populus species, occasionally willow. It is said to prefer shaded stands of its host trees. A considerable amount of frass and wood fibre are ejected from the active tunnel entrances that are formed as an enlargement of the oviposition site. Scottish sites are typically aspen, birch and juniper stands on relatively fertile, well drained morainic deposits or steep sided river gorges [MacGowan & Begg 2002]. The circumference of inhabited trees were found to be within the range 13-187cm CBH, with a mean circumference of 47.4cm; the females were selecting for small trees, with thinner bark. The height of the tunnel entrances above ground level lay with the range 119cm, the mean being 7.19cm. Most tunnel entrances were found to be at the edge of the stand, next to open ground [MacGowan & Begg 2002]. Adult beetles are active mainly at dusk and at night; they are attracted to light. They feed on the leaves of you g aspens during July and August [Lindhe et al. 2010].}'),
