(632800, E'TBiology', E'{87.027015,Alexander 2019c,associated with sun exposed, decorticated and well seasoned, standing or fallen, dead pine or spruce stems of substantial girth. The larvae develop for at least two years in the partially decayed heartwood and pupate in the wood. Suitable substrate can serve for decades. [Owen 1991] reared the beetle from pupae found in the trunk of a fallen dead pine in Abernethy Forest; the trunk was without bark and had a well weathered surface; estimated to have been dead for between 10 and 20 years; trunk diameter about 40cm and pupae in chambers arranged along the axis of the trunk 2 3cm under the surface of the wood on the side of the trunk which was exposed to the sun; emergence holes made by adults approximately round and 3-4mm in diameter; estimate 3-4 year development. These observations are very consistent with the author’s (KA) own experiences with this species in Rothiemurchus Forest. The more northern and western Caledonian pine forest areas may be climatically too damp and shady for this warmth and sun loving species.  Adults are active from late June to late July, and are attracted to the white flowers of Asteraceae, to hogweed flowers and Epilobium angustifolium (Lindhe et al. 2010).}', null, E'tbl_text_biology', 67714, '2020-03-13 13:30:30.1542070+01', E'INSERT', E'{87.027015,Alexander 2019c,associated with sun exposed, decorticated and well seasoned, standing or fallen, dead pine or spruce stems of substantial girth. The larvae develop for at least two years in the partially decayed heartwood and pupate in the wood. Suitable substrate can serve for decades. [Owen 1991] reared the beetle from pupae found in the trunk of a fallen dead pine in Abernethy Forest; the trunk was without bark and had a well weathered surface; estimated to have been dead for between 10 and 20 years; trunk diameter about 40cm and pupae in chambers arranged along the axis of the trunk 2 3cm under the surface of the wood on the side of the trunk which was exposed to the sun; emergence holes made by adults approximately round and 3-4mm in diameter; estimate 3-4 year development. These observations are very consistent with the author’s (KA) own experiences with this species in Rothiemurchus Forest. The more northern and western Caledonian pine forest areas may be climatically too damp and shady for this warmth and sun loving species.  Adults are active from late June to late July, and are attracted to the white flowers of Asteraceae, to hogweed flowers and Epilobium angustifolium (Lindhe et al. 2010).}'),
