(632812, E'TBiology', E'{14.006003,Schilthuizen 1990,prefers a wet environment, apparently, it lives in the burrows of mole (Talpa europaea), rabbit (Oryctolagus cuniculus) and several species of mice. Szymczakowski (1959) reported epigean captures from litter at the banks of streams. In mountainous areas it is, like most Choleva, sometimes found in caves (Jeannel, 1936); Coiffait (1955) qualified C. agilis as "troglophile". I\r\nwould like to observe here, that C. agilis chooses similar habitats as C. glauca with which it it often found together.}', null, E'tbl_text_biology', 67726, '2020-03-13 13:30:30.1953350+01', E'INSERT', E'{14.006003,Schilthuizen 1990,prefers a wet environment, apparently, it lives in the burrows of mole (Talpa europaea), rabbit (Oryctolagus cuniculus) and several species of mice. Szymczakowski (1959) reported epigean captures from litter at the banks of streams. In mountainous areas it is, like most Choleva, sometimes found in caves (Jeannel, 1936); Coiffait (1955) qualified C. agilis as "troglophile". I\r\nwould like to observe here, that C. agilis chooses similar habitats as C. glauca with which it it often found together.}'),
