(632816, E'TBiology', E'{34.050003,Ljungberg 2002a,in dunes example in pitfall trap, example in autumn on sandy heath with Corynephorus canescens. Also found swarming over sandy ground with sparse grassy vegetation, in a sheltered place inside the beach. It occurs on coastal dunes also on sandy fields inland, e.g. in the sand dune of the eastern part of Sweden.}', null, E'tbl_text_biology', 67730, '2020-03-13 13:30:30.2071560+01', E'INSERT', E'{34.050003,Ljungberg 2002a,in dunes example in pitfall trap, example in autumn on sandy heath with Corynephorus canescens. Also found swarming over sandy ground with sparse grassy vegetation, in a sheltered place inside the beach. It occurs on coastal dunes also on sandy fields inland, e.g. in the sand dune of the eastern part of Sweden.}'),
