(632900, E'TBiology', E'{23.117009,Lane 2019a,Predatory, little is known about habitat preferencesin Britain. [Allen 1964] found it in ‘much decayed grass heaps’ and ‘under decomposing fish’ in his garden, ‘nearly always in late autumn; rare though occasionally in small numbers’ and in the ''wettest and most putrid part of compost heaps and heaps of decaying vegetation'' (P. Hammond pers comm.). It had also been observed at the sap of a Cossus-infested tree and in woodland localities. Along with other members of the genus, it was likely to be associated with decaying organic matter in general. Adults have been recorded in February, May, June and August - December.}', null, E'tbl_text_biology', 67814, '2020-03-13 13:30:30.4934640+01', E'INSERT', E'{23.117009,Lane 2019a,Predatory, little is known about habitat preferencesin Britain. [Allen 1964] found it in ‘much decayed grass heaps’ and ‘under decomposing fish’ in his garden, ‘nearly always in late autumn; rare though occasionally in small numbers’ and in the ''wettest and most putrid part of compost heaps and heaps of decaying vegetation'' (P. Hammond pers comm.). It had also been observed at the sap of a Cossus-infested tree and in woodland localities. Along with other members of the genus, it was likely to be associated with decaying organic matter in general. Adults have been recorded in February, May, June and August - December.}'),
