(632908, E'TBiology', E'{87.060002,Alexander 2019c,Larvae develop for two years under bark and in the outer sapwood of recently dead branches and stems of oak, occasionally other hardwoods, and pupate in the wood or in thick bark [Lindhe et al. 2010]. Pupation occurs in spring. The imago emerges in May and is found in the open until July, either resting on host trees or their branches on the ground. They are very active, flying readily in sunshine and are sometimes found browsing on flower heads [Kaufmann 1992a]-}', null, E'tbl_text_biology', 67822, '2020-03-13 13:30:30.5192470+01', E'INSERT', E'{87.060002,Alexander 2019c,Larvae develop for two years under bark and in the outer sapwood of recently dead branches and stems of oak, occasionally other hardwoods, and pupate in the wood or in thick bark [Lindhe et al. 2010]. Pupation occurs in spring. The imago emerges in May and is found in the open until July, either resting on host trees or their branches on the ground. They are very active, flying readily in sunshine and are sometimes found browsing on flower heads [Kaufmann 1992a]-}'),
