(632990, E'TBiology', E'{87.020101,Alexander 2019c,In Britain the beetle is primarily associated with ancient broad leaved woodlands which are under active coppice management, and perhaps only in landscapes rich in such woodland. It will breed in a wide range of broad leaved tree species, although an association with sweet chestnut hop poles as sometimes claimed has not been substantiated. Areas of woodland on steep slopes on sandy soil appear to be favoured. The woodlands need to have areas where the sun penetrates to ground level and warms the soil hence an association with active coppice and south facing sandy slopes as the larvae are very active on the woodland floor and the adults also feed at white blossom in full sunshine. The larvae are secondary inhabitants of the subcortical zone after exploitation by scolytines and other cerambycids. Larvae were found by M.G. Fraser and E.A.J. Duffy crawling about under the loose dry bark of the exposed rotten roots of an old overturned stump of Quercus [Duffy 1953]; they are strange and unusual in general appearance, more like a malacoderm or Lepidopteran: greyish colour, conspicuous setae, long legs and anal pseudopod. They are extremely active, crawling about with the speed and ease of a typical lepidopteran larva; crawling about both on top and beneath the bark but also over the soil to other stumps. They are only found under the bark in the old galleries of other beetle larvae such as the longhorn Clytus arietis, apparently feeding on either the frass or fungal growth on the frass of the former larvae. In the late autumn the larva falls to the ground and enters the soil in which it constructs an earthen cocoon; here it overwinters and pupates the following April or May [Duffy 1953]. Development takes two years (Ehnström & Holmer 2007). [Uhthoff-Kaufmann 1989] says it is principally associated with the decaying exposed roots and dead branches of oak trees; it has also been found in ash and aspen, and abroad in chestnut, but not so in England. [Lindhe et al. 2010] associate it with deadwood on living apple trees in southern Sweden. [Palm 1959] says it has been found in large numbers under loose bark of dry crab apple Malus sylvestris branches exposed to the sun and previously used b y larvae of the bark beetle Scolytus rugulosus; also found beneath bark of aspen stems lying on ground. The adults are sun loving insects and are to be found on flowers from April to July [Twinn & Harding 1999]. Flowers reported include hawthorn, apple, guelder rose, cow parsley and meadowsweet [Hyman 1992].}', null, E'tbl_text_biology', 67904, '2020-03-13 13:30:30.7663140+01', E'INSERT', E'{87.020101,Alexander 2019c,In Britain the beetle is primarily associated with ancient broad leaved woodlands which are under active coppice management, and perhaps only in landscapes rich in such woodland. It will breed in a wide range of broad leaved tree species, although an association with sweet chestnut hop poles as sometimes claimed has not been substantiated. Areas of woodland on steep slopes on sandy soil appear to be favoured. The woodlands need to have areas where the sun penetrates to ground level and warms the soil hence an association with active coppice and south facing sandy slopes as the larvae are very active on the woodland floor and the adults also feed at white blossom in full sunshine. The larvae are secondary inhabitants of the subcortical zone after exploitation by scolytines and other cerambycids. Larvae were found by M.G. Fraser and E.A.J. Duffy crawling about under the loose dry bark of the exposed rotten roots of an old overturned stump of Quercus [Duffy 1953]; they are strange and unusual in general appearance, more like a malacoderm or Lepidopteran: greyish colour, conspicuous setae, long legs and anal pseudopod. They are extremely active, crawling about with the speed and ease of a typical lepidopteran larva; crawling about both on top and beneath the bark but also over the soil to other stumps. They are only found under the bark in the old galleries of other beetle larvae such as the longhorn Clytus arietis, apparently feeding on either the frass or fungal growth on the frass of the former larvae. In the late autumn the larva falls to the ground and enters the soil in which it constructs an earthen cocoon; here it overwinters and pupates the following April or May [Duffy 1953]. Development takes two years (Ehnström & Holmer 2007). [Uhthoff-Kaufmann 1989] says it is principally associated with the decaying exposed roots and dead branches of oak trees; it has also been found in ash and aspen, and abroad in chestnut, but not so in England. [Lindhe et al. 2010] associate it with deadwood on living apple trees in southern Sweden. [Palm 1959] says it has been found in large numbers under loose bark of dry crab apple Malus sylvestris branches exposed to the sun and previously used b y larvae of the bark beetle Scolytus rugulosus; also found beneath bark of aspen stems lying on ground. The adults are sun loving insects and are to be found on flowers from April to July [Twinn & Harding 1999]. Flowers reported include hawthorn, apple, guelder rose, cow parsley and meadowsweet [Hyman 1992].}'),
