(633015, E'TBiology', E'{1.014002,Baehr 1979,digs deep holes in sandy areas. The burrowing behaviour is basically different from that of other carabid beetles so far observed. When burrowing, unlike many other burrowing animals, no alternate motions are carried out by the deeply flattened foretibias. Instead, the tibiae are held beside the long mandibles and the broadly flattened underparts of the head which is bent downwards. In that manner a very large shovel-like area is built. By moving backwards the beetle carries all the sand out of his hole, which is behind the ‘shovel’.}', null, E'tbl_text_biology', 67929, '2020-03-13 13:30:30.8438020+01', E'INSERT', E'{1.014002,Baehr 1979,digs deep holes in sandy areas. The burrowing behaviour is basically different from that of other carabid beetles so far observed. When burrowing, unlike many other burrowing animals, no alternate motions are carried out by the deeply flattened foretibias. Instead, the tibiae are held beside the long mandibles and the broadly flattened underparts of the head which is bent downwards. In that manner a very large shovel-like area is built. By moving backwards the beetle carries all the sand out of his hole, which is behind the ‘shovel’.}'),
