(633059, E'TBiology', E'{23.0120013,Shavrin 2016,inhabits mixed deciduous-coniferous forests with Betula, Picea and Pinus, deciduous forest with Betula and Populus, flood plain deciduous forests with Salix, Alnus, Populus and Betula. It most often inhabits communities with Carex spp., Poaceae, Filipendula, Comarum, Equisetum sp., Sphagnum spp. and other plants and mosses. The species is recorded in Estonia from low and intermediate elevations between 70 m a.s.l. and 930 m a.s.l.. According to published data, the species was observed under bark, in wet grasses between tussocks, among plant debris on marshy or very moist ground and often on inundated river banks or lake shores with Salix, in marshes and Sphagnum bogs, under plant remains on very wet swampy ponds and meadows with ''cane'', sedge, grasses and hay, in wet litter under Salix and Alnus, etc. The beetles were observed almost all year from January to November (in Scandinavia), with most specimens observed from mid-April to the end of September; the largest number of specimens was recorded in late summer (August) and in September. Pycnoglypta lurida can be regarded as a mesophilous to hygromesophilous species since it inhabits wet moss and litter under wood and bushes; it evidently avoids the earliest stages of wetland series of plant succession, as well as xerophytous habitats in general.}', null, E'tbl_text_biology', 67973, '2020-03-13 13:30:30.9964750+01', E'INSERT', E'{23.0120013,Shavrin 2016,inhabits mixed deciduous-coniferous forests with Betula, Picea and Pinus, deciduous forest with Betula and Populus, flood plain deciduous forests with Salix, Alnus, Populus and Betula. It most often inhabits communities with Carex spp., Poaceae, Filipendula, Comarum, Equisetum sp., Sphagnum spp. and other plants and mosses. The species is recorded in Estonia from low and intermediate elevations between 70 m a.s.l. and 930 m a.s.l.. According to published data, the species was observed under bark, in wet grasses between tussocks, among plant debris on marshy or very moist ground and often on inundated river banks or lake shores with Salix, in marshes and Sphagnum bogs, under plant remains on very wet swampy ponds and meadows with ''cane'', sedge, grasses and hay, in wet litter under Salix and Alnus, etc. The beetles were observed almost all year from January to November (in Scandinavia), with most specimens observed from mid-April to the end of September; the largest number of specimens was recorded in late summer (August) and in September. Pycnoglypta lurida can be regarded as a mesophilous to hygromesophilous species since it inhabits wet moss and litter under wood and bushes; it evidently avoids the earliest stages of wetland series of plant succession, as well as xerophytous habitats in general.}'),
