(633079, E'TBiology', E'{23.109032,Lane 2019a,a predatory species on small invertebrates. mainly in wet woodland and in wooded fen and carr habitats where it is found in the ground layer, usually in leaf litter, bracken litter or in moss (including Sphagnum). However, two out of the three post-1989 records from East Anglia originate from litter heaps resulting from cut vegetation in fen habitat. It has also been pitfall-trapped in serpentinite grassland in South Ayrshire. Adults have been recorded in Britain from March to June, August to October and in December.}', null, E'tbl_text_biology', 67993, '2020-03-13 13:30:31.0611110+01', E'INSERT', E'{23.109032,Lane 2019a,a predatory species on small invertebrates. mainly in wet woodland and in wooded fen and carr habitats where it is found in the ground layer, usually in leaf litter, bracken litter or in moss (including Sphagnum). However, two out of the three post-1989 records from East Anglia originate from litter heaps resulting from cut vegetation in fen habitat. It has also been pitfall-trapped in serpentinite grassland in South Ayrshire. Adults have been recorded in Britain from March to June, August to October and in December.}'),
