(633133, E'TBiology', E'{1.011101,Lindroth 1945,incompletely known. According to the records it is a decidedly riparian sp., mostly in strongly swampy moss covered places, especially  on Sphagnum and Hypna quaking ground on lake shores and on boggy meadow soils.  In its habitat it appears to come fairly close to Elaphrus lapponicus, as it is a distinctly `spring insect''.  At Tol Abisko there was a solitary example with Dyschirius helleni (= nigricornis)  in the typical habitat for this species.  From the upper part of the coniferous zone as far as the lower part of the Regio alpina.   Wings well developed and flies.}', null, E'tbl_text_biology', 68047, '2020-03-13 13:30:31.2347260+01', E'INSERT', E'{1.011101,Lindroth 1945,incompletely known. According to the records it is a decidedly riparian sp., mostly in strongly swampy moss covered places, especially  on Sphagnum and Hypna quaking ground on lake shores and on boggy meadow soils.  In its habitat it appears to come fairly close to Elaphrus lapponicus, as it is a distinctly `spring insect''.  At Tol Abisko there was a solitary example with Dyschirius helleni (= nigricornis)  in the typical habitat for this species.  From the upper part of the coniferous zone as far as the lower part of the Regio alpina.   Wings well developed and flies.}'),
