(633137, E'TBiology', E'{23.030002,Webster et al. 2012,in arctic and alpine tundra areas south into the boreal forest. Relict populations from New Hampshire and Maine occur in alpine areas. Adults have been found in leaf litter, in wet moss, and under rocks near streams, in flood debris near rivers, inside a beaver lodge, and in wet moss and clumps of dead grass in alpine tundra. The specimen from New Brunswick was sifted from moss and leaf litter, near a brook in an old-growth eastern white cedar (Thuja occidentalis L.) swamp during May.}', null, E'tbl_text_biology', 68051, '2020-03-13 13:30:31.2479000+01', E'INSERT', E'{23.030002,Webster et al. 2012,in arctic and alpine tundra areas south into the boreal forest. Relict populations from New Hampshire and Maine occur in alpine areas. Adults have been found in leaf litter, in wet moss, and under rocks near streams, in flood debris near rivers, inside a beaver lodge, and in wet moss and clumps of dead grass in alpine tundra. The specimen from New Brunswick was sifted from moss and leaf litter, near a brook in an old-growth eastern white cedar (Thuja occidentalis L.) swamp during May.}'),
