(633151, E'TBiology', E'{87.079001,Alexander 2019c,Larvae develop for a couple of months in the inner bark of recently dead, standing and fallen stems and stumps of pine, sometimes spruce, and pupate in the wood. Males use the surface of fresh pine stumps as arenas to fight over females (Lindhe et al. 2010). Larvae and pupae are capable of resisting long  periods of immersion in sea water. It seems that pupation happens twice annually; once in summer, August and September, when the adults emerge into the open to dry off, and again in October, in which ev ent the pupa or the imago will over winter in situ . Adults and lately ecloded beetles therefore appear as early as March in the following year (Kaufmann 1992b). Although the main emergence period is in August and September, adults have been found overwintering in their pupal cells, and adults have been found active in late April and early May at Rothiemurchus (Welch, 1972). However, [Owen 1999] states that this species is to be seen on pine stumps and logs from March until late summer, most plentifully in J une and July. It is abundant in the large pine forests of northern Europe and often taken far from trees, suggesting high mobility.}', null, E'tbl_text_biology', 68065, '2020-03-13 13:30:31.2987810+01', E'INSERT', E'{87.079001,Alexander 2019c,Larvae develop for a couple of months in the inner bark of recently dead, standing and fallen stems and stumps of pine, sometimes spruce, and pupate in the wood. Males use the surface of fresh pine stumps as arenas to fight over females (Lindhe et al. 2010). Larvae and pupae are capable of resisting long  periods of immersion in sea water. It seems that pupation happens twice annually; once in summer, August and September, when the adults emerge into the open to dry off, and again in October, in which ev ent the pupa or the imago will over winter in situ . Adults and lately ecloded beetles therefore appear as early as March in the following year (Kaufmann 1992b). Although the main emergence period is in August and September, adults have been found overwintering in their pupal cells, and adults have been found active in late April and early May at Rothiemurchus (Welch, 1972). However, [Owen 1999] states that this species is to be seen on pine stumps and logs from March until late summer, most plentifully in J une and July. It is abundant in the large pine forests of northern Europe and often taken far from trees, suggesting high mobility.}'),
