(633184, E'TBiology', E'{23.0260121,Webster et al. 2012,collected from moss and Carex hummocks, along lake, stream, and bog margins, from floating debris on streams, and in moist Salix and Alnus spp. Litter. Most specimens from New Brunswick were collected from moss, sphagnum, and leaf litter in and near eastern white cedar swamps and in Carex marshes. Adults were collected by sifting moss and litter or treading Carex hummocks and vegetation into water. This species was collected during April, May, June, July, and August.}', null, E'tbl_text_biology', 68098, '2020-03-13 13:30:31.4687750+01', E'INSERT', E'{23.0260121,Webster et al. 2012,collected from moss and Carex hummocks, along lake, stream, and bog margins, from floating debris on streams, and in moist Salix and Alnus spp. Litter. Most specimens from New Brunswick were collected from moss, sphagnum, and leaf litter in and near eastern white cedar swamps and in Carex marshes. Adults were collected by sifting moss and litter or treading Carex hummocks and vegetation into water. This species was collected during April, May, June, July, and August.}'),
