(633190, E'TBiology', E'{47.004002,Johnson 1990b,(US) numerous adults observed feeding, mating and ovipositing on mats of the abundant pioneer moss Dicranella heteromalla, Atrichum angustatum was frequently mixed with this moss but not fed upon by either adults or larvae in the laboratory or field. These mosses were found amongst barren soil at trail margins and between the roots of Quercus rubra L. and Acer saccharum. In Scotland, S. semistriata has been observed feeding on Mnium hornum (R. Crowson, in litt.). Mosses of this genus prefer perennially moister microsites than are D. heteromalla and are abundant throughout North America. Overwinters as 1st instar larva.}', null, E'tbl_text_biology', 68104, '2020-03-13 13:30:31.4862950+01', E'INSERT', E'{47.004002,Johnson 1990b,(US) numerous adults observed feeding, mating and ovipositing on mats of the abundant pioneer moss Dicranella heteromalla, Atrichum angustatum was frequently mixed with this moss but not fed upon by either adults or larvae in the laboratory or field. These mosses were found amongst barren soil at trail margins and between the roots of Quercus rubra L. and Acer saccharum. In Scotland, S. semistriata has been observed feeding on Mnium hornum (R. Crowson, in litt.). Mosses of this genus prefer perennially moister microsites than are D. heteromalla and are abundant throughout North America. Overwinters as 1st instar larva.}'),
