(633214, E'TBiology', E'{87.027002,Alexander 2019c,A relict species of old forest areas, the larvae seem to develop specifically in the dead wood of oak that has been decayed by the fungus Hymenochaete rubiginosa [Ehnström & Axelsson 2002]. This fungus is most often found fruiting on old, well seasoned and decorticated oak stumps and lying oak deadwood in humid fairly shaded situations but may also be active in the old deadwood of standing living oak trees provided the dead heartwood is exposed externally to the air. The Castle Hill site still has areas of a more typical open wood pasture structure, and so shelter and shade may be more important in the south of Britain. Although [Ehnström & Axelsson 2002] state that it is the decayed sapwood that is the larval habitat and that the type of decay is a red rot, they were clearly unfamiliar with the biology of the host fungus. H rubiginosa is a heartwood decay fungus, decaying heartwood residues of old oak stumps. The resulting decay is a fine powdery material, red/brown in colour, but the result of a white rot process rather than being a true red rot (M. Ainsworth, pers. comm.). Adults are active for a limited period (5 to 6 weeks, but probably only 3 to 4 weeks in any one season) from late May until early July and favour open sunny areas fly ing actively to blossom in the field layer they are known to be attracted to the white flowers of Meadowsweet, Angelica, Valeriana and Thalictrum. Ecological continuity appears to be a key factor, the known sites all being ancient wood pastures or ancient woodland, and part of large complexes of suitable habitat. However, the sites are not necessarily species rich in saproxylics. The host fungus is relatively widespread but perhaps only rarely does it provide sufficient habit at at landscape scale.}', null, E'tbl_text_biology', 68128, '2020-03-13 13:30:31.5712480+01', E'INSERT', E'{87.027002,Alexander 2019c,A relict species of old forest areas, the larvae seem to develop specifically in the dead wood of oak that has been decayed by the fungus Hymenochaete rubiginosa [Ehnström & Axelsson 2002]. This fungus is most often found fruiting on old, well seasoned and decorticated oak stumps and lying oak deadwood in humid fairly shaded situations but may also be active in the old deadwood of standing living oak trees provided the dead heartwood is exposed externally to the air. The Castle Hill site still has areas of a more typical open wood pasture structure, and so shelter and shade may be more important in the south of Britain. Although [Ehnström & Axelsson 2002] state that it is the decayed sapwood that is the larval habitat and that the type of decay is a red rot, they were clearly unfamiliar with the biology of the host fungus. H rubiginosa is a heartwood decay fungus, decaying heartwood residues of old oak stumps. The resulting decay is a fine powdery material, red/brown in colour, but the result of a white rot process rather than being a true red rot (M. Ainsworth, pers. comm.). Adults are active for a limited period (5 to 6 weeks, but probably only 3 to 4 weeks in any one season) from late May until early July and favour open sunny areas fly ing actively to blossom in the field layer they are known to be attracted to the white flowers of Meadowsweet, Angelica, Valeriana and Thalictrum. Ecological continuity appears to be a key factor, the known sites all being ancient wood pastures or ancient woodland, and part of large complexes of suitable habitat. However, the sites are not necessarily species rich in saproxylics. The host fungus is relatively widespread but perhaps only rarely does it provide sufficient habit at at landscape scale.}'),
