(633346, E'TBiology', E'{88.017003,Hubble 2014,Usually recorded on young birch Betula, sometimes on a range of other trees such as alders, Alnus, hazel, Corylus avellana, hawthorn, Crataegus monogyna, pedunculate oak, Quercus robur, and willows, Salix. In clearing and ride margins in broadleaved woodland on south-facing slopes, chalk downland, and moors/heathland. Adults feed on leaves of birches, Betula, and other trees, larvae feed on fallen tree leaves and possibly fallen catkins. Recent survey work [Pendleton & Pendleton 2013] suggests that the ‘traditional’ association with young birch may not be entirely correct as tree-top surveys found that branches of thicker foliage, with a sunny aspect and around 30 feet above the ground were favoured, with lower-level vegetation possibly used by newly emerged adults prior to their first flight, as well as being easier to search. Leaf quality appears important as no adults were found at the top of the largest birches (around 50 feet) where foliage was noticeably poor. Loss of habitat through clear-felling and conversion to conifer forestry, also habitat degradation through neglect leading to development into high forest.}', null, E'tbl_text_biology', 68260, '2020-03-13 13:30:32.0217380+01', E'INSERT', E'{88.017003,Hubble 2014,Usually recorded on young birch Betula, sometimes on a range of other trees such as alders, Alnus, hazel, Corylus avellana, hawthorn, Crataegus monogyna, pedunculate oak, Quercus robur, and willows, Salix. In clearing and ride margins in broadleaved woodland on south-facing slopes, chalk downland, and moors/heathland. Adults feed on leaves of birches, Betula, and other trees, larvae feed on fallen tree leaves and possibly fallen catkins. Recent survey work [Pendleton & Pendleton 2013] suggests that the ‘traditional’ association with young birch may not be entirely correct as tree-top surveys found that branches of thicker foliage, with a sunny aspect and around 30 feet above the ground were favoured, with lower-level vegetation possibly used by newly emerged adults prior to their first flight, as well as being easier to search. Leaf quality appears important as no adults were found at the top of the largest birches (around 50 feet) where foliage was noticeably poor. Loss of habitat through clear-felling and conversion to conifer forestry, also habitat degradation through neglect leading to development into high forest.}'),
