(633361, E'TBiology', E'{23.0280012,Webster et al. 2012,Adults of this northern species are typically found by sifting Alnus and Salix spp. litter near margins of bogs, shallow lakes, and streams. They are also found in Carex hummocks (collected by treading hummocks into water) and in bird nests on ground. Most of the New Brunswick specimens were collected from a wet (emergent sedges) sedge marsh near a small lake by treading sedges and grasses near Myrica bushes into water. Two adults were found in leaf litter and moss under alders near a small brook in a Carex marsh, and one individual was found under a cobblestone on a shaded cobblestone bar in a brook. Adults were collected during May, June, and July.}', null, E'tbl_text_biology', 68275, '2020-03-13 13:30:32.0677510+01', E'INSERT', E'{23.0280012,Webster et al. 2012,Adults of this northern species are typically found by sifting Alnus and Salix spp. litter near margins of bogs, shallow lakes, and streams. They are also found in Carex hummocks (collected by treading hummocks into water) and in bird nests on ground. Most of the New Brunswick specimens were collected from a wet (emergent sedges) sedge marsh near a small lake by treading sedges and grasses near Myrica bushes into water. Two adults were found in leaf litter and moss under alders near a small brook in a Carex marsh, and one individual was found under a cobblestone on a shaded cobblestone bar in a brook. Adults were collected during May, June, and July.}'),
