(633467, E'TBiology', E'{47.014001,Johnson 1990b,(North America) primarily in disturbed, moist habitats, with silty top soil or exposures. Most frequently, these sites are anthropogenic. The habitats I have examined typically contain large expanses of moss protonemata and algae, which appear to constitute the primary food sources. On banks of the Kootenai River and railway and highway embankments in northern Idaho, large populations of this beetle were associated with the mosses Pohlia atropurpurea, Dicranella varia, and Aloina brevirostris, although only the former two, with a Nostoc sp. of alga, have been confirmed as hosts. The Kootenai River site is characterized by cement rip-rap overlain by riverine silt, while the other sites are embankments cut into deep glacial clay-silts. Elsewhere, other gross habitat associations include unpaved roadways, gardens, and agricultural fields. Specimens have also been collected in-flight from late afternoon through dusk.}', null, E'tbl_text_biology', 68381, '2020-03-13 13:30:32.4134240+01', E'INSERT', E'{47.014001,Johnson 1990b,(North America) primarily in disturbed, moist habitats, with silty top soil or exposures. Most frequently, these sites are anthropogenic. The habitats I have examined typically contain large expanses of moss protonemata and algae, which appear to constitute the primary food sources. On banks of the Kootenai River and railway and highway embankments in northern Idaho, large populations of this beetle were associated with the mosses Pohlia atropurpurea, Dicranella varia, and Aloina brevirostris, although only the former two, with a Nostoc sp. of alga, have been confirmed as hosts. The Kootenai River site is characterized by cement rip-rap overlain by riverine silt, while the other sites are embankments cut into deep glacial clay-silts. Elsewhere, other gross habitat associations include unpaved roadways, gardens, and agricultural fields. Specimens have also been collected in-flight from late afternoon through dusk.}'),
