(633537, E'TBiology', E'{70.004001,Palm 1959,never in woodland, larvae exclusively in worked wood of conifers and deciduous trees. In Sweden, author only knows the sp from conifer railway (pine) sleepers in moist clay, near coast at Lomma (Skåne.). In Denmark, from deciduous wood, e.g. oak. Only from wet wood which does not dry out wood in stagnant moist earth or in water e.g. bridge piers, bathing huts, duck boards. Known in Sweden for its damage in dock areas but not to a great extent. Larva, pupae and adults in late June. Development a minimum of 2 yrs.}', null, E'tbl_text_biology', 68451, '2020-03-13 13:30:32.6060220+01', E'INSERT', E'{70.004001,Palm 1959,never in woodland, larvae exclusively in worked wood of conifers and deciduous trees. In Sweden, author only knows the sp from conifer railway (pine) sleepers in moist clay, near coast at Lomma (Skåne.). In Denmark, from deciduous wood, e.g. oak. Only from wet wood which does not dry out wood in stagnant moist earth or in water e.g. bridge piers, bathing huts, duck boards. Known in Sweden for its damage in dock areas but not to a great extent. Larva, pupae and adults in late June. Development a minimum of 2 yrs.}'),
(633538, E'TBiology', E'{23.107001,Webster et al. 2012,reported from forested areas under bark, in litter, in fungi and from compost. In New Brunswick, this adventive species was common among decaying leaves in a pile of leaves made the previous year. Other adults were observed among a pile of decaying corncobs and cornhusks nearby and from compost. Adults were also found under bark of spruce in a woodpile, in decaying fungi, in the wall of a beaver lodge and at a black-light trap. Adults were collected during April, May, July, and August.}', null, E'tbl_text_biology', 68452, '2020-03-13 13:30:32.6088820+01', E'INSERT', E'{23.107001,Webster et al. 2012,reported from forested areas under bark, in litter, in fungi and from compost. In New Brunswick, this adventive species was common among decaying leaves in a pile of leaves made the previous year. Other adults were observed among a pile of decaying corncobs and cornhusks nearby and from compost. Adults were also found under bark of spruce in a woodpile, in decaying fungi, in the wall of a beaver lodge and at a black-light trap. Adults were collected during April, May, July, and August.}'),
