(633577, E'TBiology', E'{3060.0400032,Douwes et al. 2012,occurs on more or less open, sandy soil with sparse and short vegetation. Nests, which can extend more than one metre below the ground surface, have an extensive horizontal tunnel system in which the ants mainly move. Above ground, they are predominantly night active. Swarming takes place from the end of July and during August.}', null, E'tbl_text_biology', 68491, '2020-03-13 13:30:32.7309780+01', E'INSERT', E'{3060.0400032,Douwes et al. 2012,occurs on more or less open, sandy soil with sparse and short vegetation. Nests, which can extend more than one metre below the ground surface, have an extensive horizontal tunnel system in which the ants mainly move. Above ground, they are predominantly night active. Swarming takes place from the end of July and during August.}'),
