(633579, E'TBiology', E'{87.028001,Alexander 2019c,Larvae develop for two years under the basal bark and in the wood lower dead standing and fallen Picea and Pinus feeding in the decaying sapwood below ground level [Lindhe et al. 2010]; also in rotting stumps; they pupate in a shallow earthen cell near host tree''s roots; found especially in shady situations. [Bense 1995] adds Larix, Abies, Populus and Tilia as host trees; [Bily & Mehl 1989] also say that it is occasionally found in broadleaved trees, including Alnus; no data on size classes of utilized stumps and trunks appear to be available. The term ‘large’ is rarely if ever used by recorders and so size class may not be important. Adults are attracted to white flowers for feeding in June and July, into early August (Lindhe et al. 2010); hogweed & rowan [Harwood 1933]. Associated with ancient woodland in Britain (Rejzek 2006).}', null, E'tbl_text_biology', 68493, '2020-03-13 13:30:32.7372860+01', E'INSERT', E'{87.028001,Alexander 2019c,Larvae develop for two years under the basal bark and in the wood lower dead standing and fallen Picea and Pinus feeding in the decaying sapwood below ground level [Lindhe et al. 2010]; also in rotting stumps; they pupate in a shallow earthen cell near host tree''s roots; found especially in shady situations. [Bense 1995] adds Larix, Abies, Populus and Tilia as host trees; [Bily & Mehl 1989] also say that it is occasionally found in broadleaved trees, including Alnus; no data on size classes of utilized stumps and trunks appear to be available. The term ‘large’ is rarely if ever used by recorders and so size class may not be important. Adults are attracted to white flowers for feeding in June and July, into early August (Lindhe et al. 2010); hogweed & rowan [Harwood 1933]. Associated with ancient woodland in Britain (Rejzek 2006).}'),
