(633632, E'TBiology', E'{85.019023,Roslin et al 2014,thrives best in the shade, but that shade should be warm. Therefore, the species is mainly found on warm sheep pasture in pine forests on sandy land, and in warm southern deciduous forests with deer dung. Adult are found mainly during late summer, and the species thus appears to overwinter in the third larval stage. However, scattered finds have been made from June to October. In Sweden in regions with a lot of deer or good forest grazing it is no longer uncommon.}', null, E'tbl_text_biology', 68546, '2020-03-13 13:30:33.0041990+01', E'INSERT', E'{85.019023,Roslin et al 2014,thrives best in the shade, but that shade should be warm. Therefore, the species is mainly found on warm sheep pasture in pine forests on sandy land, and in warm southern deciduous forests with deer dung. Adult are found mainly during late summer, and the species thus appears to overwinter in the third larval stage. However, scattered finds have been made from June to October. In Sweden in regions with a lot of deer or good forest grazing it is no longer uncommon.}'),
