(633666, E'TBiology', E'{80.001003,Tamutis et al 2019,Associated with bracket fungi, with its larvae developing in Peniophora rufomarginata and Chondrostereum purpurem. Adults were found also on Bjerkandera adusta, Fomes fomentarius, Phellinus punctatus, Piptoporus\r\nbetulinus, and Tremella mesenterica.}', null, E'tbl_text_biology', 68580, '2020-03-13 13:30:33.1037440+01', E'INSERT', E'{80.001003,Tamutis et al 2019,Associated with bracket fungi, with its larvae developing in Peniophora rufomarginata and Chondrostereum purpurem. Adults were found also on Bjerkandera adusta, Fomes fomentarius, Phellinus punctatus, Piptoporus\r\nbetulinus, and Tremella mesenterica.}'),
