(633753, E'TBiology', E'{23.051024,SLU ArtDatabanken 2017,Lives underground in damp, vegetation-free sand and silty sand on shores of water bodies. The Swedish finds are made in gravel pits with ponds in the bottom. The species is found near the waterline and occurs mainly in places where the water has deposited some organic matter on the otherwise "sterile" mineral ground. Whether or not the species lives as a predator on all small springtails found in the sand, or if it lives on green algae in the sand, we do not know. The best way to capture this species, as well as several other species that live in a similar way, is to put the sand from the water surface around the puddles in a bowl of water and disturb the sand and observe all that floats on the surface of the water. This species floats because of its hairs high up on the water surface and quickly takes to the wing and disappears.}', null, E'tbl_text_biology', 68667, '2020-03-13 13:30:33.3601610+01', E'INSERT', E'{23.051024,SLU ArtDatabanken 2017,Lives underground in damp, vegetation-free sand and silty sand on shores of water bodies. The Swedish finds are made in gravel pits with ponds in the bottom. The species is found near the waterline and occurs mainly in places where the water has deposited some organic matter on the otherwise "sterile" mineral ground. Whether or not the species lives as a predator on all small springtails found in the sand, or if it lives on green algae in the sand, we do not know. The best way to capture this species, as well as several other species that live in a similar way, is to put the sand from the water surface around the puddles in a bowl of water and disturb the sand and observe all that floats on the surface of the water. This species floats because of its hairs high up on the water surface and quickly takes to the wing and disappears.}'),
