(633801, E'TTaxoNotes', E'{23.117009,Lane 2019a,identified amongst the other British species by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the blackish antennae with paler basal segments, the lack of setae at the sides of the four basal abdominal segments, quadrate to elongate (rather than quadrate to transverse) antennal segments 6-10, the shape of the apex of the last abdominal tergite (which is similar to that of pallipes), the completely black pronotal front margin, the punctation of the pronotum and elytra being almost identical and a small ± well-defined reddish-yellow mark at the humeral angle of the elytra. The aedeagus is diagnostic but only by comparison with other Tachinus.}', null, E'tbl_taxonomy_notes', 12819, '2020-03-13 13:32:14.1319590+01', E'INSERT', E'{23.117009,Lane 2019a,identified amongst the other British species by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the blackish antennae with paler basal segments, the lack of setae at the sides of the four basal abdominal segments, quadrate to elongate (rather than quadrate to transverse) antennal segments 6-10, the shape of the apex of the last abdominal tergite (which is similar to that of pallipes), the completely black pronotal front margin, the punctation of the pronotum and elytra being almost identical and a small ± well-defined reddish-yellow mark at the humeral angle of the elytra. The aedeagus is diagnostic but only by comparison with other Tachinus.}'),
