(633815, E'TTaxoNotes', E'{23.109032,Lane 2019a,The genus can be distinguished by the raised border along the suture, the maxillary palp with a much narrower apical joint relative to the subapical segment and the antennal segments which are appreciably longer than in the closely-related Mycetoporus. It differs from I splendidum in being generally larger, with a less elongate head that lacks microsculpture on the dorsal surface and in the male, by the different arrangement of setae on the 5th and 6th sternites.}', null, E'tbl_taxonomy_notes', 12833, '2020-03-13 13:32:14.1780580+01', E'INSERT', E'{23.109032,Lane 2019a,The genus can be distinguished by the raised border along the suture, the maxillary palp with a much narrower apical joint relative to the subapical segment and the antennal segments which are appreciably longer than in the closely-related Mycetoporus. It differs from I splendidum in being generally larger, with a less elongate head that lacks microsculpture on the dorsal surface and in the male, by the different arrangement of setae on the 5th and 6th sternites.}'),
