(633825, E'TTaxoNotes', E'{23.111009,Lane 2019a,This distinctive species exhibits the significantly narrowed abdomen typical of the Tachyporinae. It is further differentiated by the raised elytral border along the suture, by having the terminal segment of the maxillary palp of similar width to the sub-apical segment, as broad at its base as that segment and distinctly elongate, with the pronotum not entirely black and the elytra having at least one row of longitudinal punctures. From the closely superficial L lunulatus, it can be separated by size (8.0-10.8mm vs. 5.0-7.0mm), the colouration of the elytra (scutellum and base of elytra are orange) and the structure of the aedeagus.}', null, E'tbl_taxonomy_notes', 12843, '2020-03-13 13:32:14.2135320+01', E'INSERT', E'{23.111009,Lane 2019a,This distinctive species exhibits the significantly narrowed abdomen typical of the Tachyporinae. It is further differentiated by the raised elytral border along the suture, by having the terminal segment of the maxillary palp of similar width to the sub-apical segment, as broad at its base as that segment and distinctly elongate, with the pronotum not entirely black and the elytra having at least one row of longitudinal punctures. From the closely superficial L lunulatus, it can be separated by size (8.0-10.8mm vs. 5.0-7.0mm), the colouration of the elytra (scutellum and base of elytra are orange) and the structure of the aedeagus.}'),
