(633840, E'TTaxoNotes', E'{23.117008,Lane 2019a,T. bipustulatus is identified by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the reddish (rather than black) antennal base, the lack of setae at the sides of the four basal abdominal segments, quadrate to transverse (rather than quadrate to elongate) antennal segments 6-10, the shape of the apex of the last abdominal tergite, the colouration of the antennae which are typically entirely reddish or only very indistinctly pitchy towards their apices, the red to pitchy-red legs and a small ± well-defined reddish-yellow marks at the humeral angles of the elytra. The structure of the aedeagus is also useful, but only by comparison with other Tachinus.}', null, E'tbl_taxonomy_notes', 12858, '2020-03-13 13:32:14.3014690+01', E'INSERT', E'{23.117008,Lane 2019a,T. bipustulatus is identified by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the reddish (rather than black) antennal base, the lack of setae at the sides of the four basal abdominal segments, quadrate to transverse (rather than quadrate to elongate) antennal segments 6-10, the shape of the apex of the last abdominal tergite, the colouration of the antennae which are typically entirely reddish or only very indistinctly pitchy towards their apices, the red to pitchy-red legs and a small ± well-defined reddish-yellow marks at the humeral angles of the elytra. The structure of the aedeagus is also useful, but only by comparison with other Tachinus.}'),
